24 XXX: An Axel Braun Parody

Year: 2014

Genre: Action, Comedy, Feature, Parody

Production Company : Wicked Pictures

Starring: Alektra Blue, Ash Hollywood, Claire Robbins, Kaylani Lei, Penny Pax

Plots: He's back and he's gonna need a hacksaw! Legendary director and 24 mega-fan Axel Braun delivers porn parody gold with this hilariously sexy spoof featuring uber bad-ass Jack Bauer on the longest, funniest day of his life. Think you can't laugh your ass off, be hugely entertained, and get totally turned on at the same time? You don't know Jack!

